$.axm=A.a(["\uc81c\uc8fc\uc2dc \uc870\ucc9c\uc74d\uc5d0 \uc704\uce58\ud55c \uac70\ubb38\uc624\ub984\uc740 \ucc9c\uc5f0\uae30\ub150\ubb3c 444\ud638\uc774\uc790 \uc138\uacc4\uc790\uc5f0\uc720\uc0b0\uc73c\ub85c \uc9c0\uc815\ub418\uc5c8\uc73c\uba70, \ub2e4\uc591\ud55c \ud654\uc0b0\uc9c0\ud615\uc774 \uc798 \ubc1c\ub2ec\ud574 \uc788\uc2b5\ub2c8\ub2e4. \uc774\uacf3\uc740 \uc81c\uc8fc\ub3c4\uc5d0\uc11c \uc720\uc77c\ud558\uac8c \uc608\uc57d\uc774 \ud544\uc694\ud55c \uc624\ub984\uc73c\ub85c \uc18c\uc218\uc758 \uc778\uc6d0 \ub0b4\uc5d0\uc11c \uc870\uc6a9\ud788 \ud2b8\ub798\ud0b9\ud560 \uc218 \uc788\ub294 \ucd5c\uc801\uc758 \uc7a5\uc18c\uc785\ub2c8\ub2e4. ","\uc2e0\uccb4\uc801, \uc815\uc2e0\uc801 \uac74\uac15 \uc99d\uc9c4\uc744 \ubaa9\uc801\uc73c\ub85c \uc0b0\ub9bc\uc758 \ub2e4\uc591\ud55c \ud658\uacbd\uc694\uc18c\ub97c \ud65c\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \uc870\uc131\ud55c \uc0b0\ub9bc\uc744 \uc77c\uceeb\ub294 \uce58\uc720\uc758 \uc232\uc5d0\uc11c \ud3b8\uc548\ud568\uacfc \uc27c\uc744 \ub290\uaef4\ubcf4\uc138\uc694. \uc0b0\ub9bc\uc695\uc744 \ud560 \uc218 \uc788\ub294 \uacf5\uac04\uc774 \ub9c8\ub828\ub418\uc5b4 \uc788\uc5b4 \ud53c\ud1a4\uce58\ub4dc\ud5a5\uc744 \ub9e1\uc73c\uba70 \ud790\ub9c1\uc744 \ub290\uaef4\ubcf4\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\ub9d1\uc740 \ub0a0\uc5d0\ub3c4 \uc88b\uc9c0\ub9cc \ud750\ub9ac\uace0 \uc548\uac1c\uac00 \uac00\ub4dd\ud55c \ub0a0 \ub354\uc6b1 \ubabd\ud658\uc801\uc778 \ubd84\uc704\uae30\ub97c \ubf50\ub0b4\ub294 \uc232\uc73c\ub85c \uac77\ub2e4\ubcf4\uba74 \ub9c8\uc2a4\ud06c \uc548\uc73c\ub85c \ub4e4\uc5b4\uc624\ub294 \uc0c1\ucf8c\ud55c \uc232\ub0b4\uc74c\uc5d0 \uae30\ubd84\uc774 \uc808\ub85c \uc88b\uc544\uc9d1\ub2c8\ub2e4."],t.m)
